class SecurityDB:
    _instance = None
    def __new__(cls):
        if cls._instance is None:
            cls._instance = super(SecurityDB, cls).__new__(cls)
            cls._instance.conn = sqlite3.connect("bot_data.db", check_same_thread=False)
            cls._instance.conn.row_factory = sqlite3.Row
        return cls._instance
    def execute(self, sql, params=()):
        cursor = self.conn.cursor()
        cursor.execute(sql, params)
        self.conn.commit()
        return cursor
    def fetch(self, sql, params=()):
        cursor = self.conn.cursor()
        cursor.execute(sql, params)
        return cursor.fetchone()
db = SecurityDB()

class AIEngine:
    def __init__(self, api_key):
        self.enabled = bool(api_key)
        if self.enabled:
            genai.configure(api_key=api_key)
            self.model = genai.GenerativeModel("gemini-pro")

    async def analyze_incident(self, category, details):
        if not self.enabled: return "AI analysis disabled."
        prompt = f"Analyze this Discord security incident in {category}: {details}. Provide a threat assessment and recommendation."
        try:
            response = await asyncio.to_thread(self.model.generate_content, prompt)
            return response.text
        except Exception as e:
            return f"AI analysis failed: {e}"

class EnterpriseBot(commands.Bot):
    def __init__(self):
        intents = discord.Intents.all()
        super().__init__(command_prefix="!", intents=intents, help_command=None)
        self.owner_id = int(os.getenv("OWNER_ID", "0"))
        self.target_guild_id = int(os.getenv("GUILD_ID", "0"))
        self.ai = AIEngine(os.getenv("GEMINI_API_KEY"))

    async def setup_hook(self):
        await self.add_cog(AntiRaidCog(self))
        await self.add_cog(AntiStaffCog(self))
        await self.add_cog(AntiWebhookCog(self))
        await self.add_cog(AnalyticsCog(self))
        await self.add_cog(SecurityEvents(self))
        await self.add_cog(AIInsightsCog(self))
        await self.add_cog(EncyclopediaCog(self))
        await self.tree.sync()

    async def notify_owner(self, title, details, color=discord.Color.red()):
        owner = self.get_user(self.owner_id)
        cur = db.execute("INSERT INTO incidents (guild_id, category, severity, details) VALUES (?, ?, ?, ?)",
                         (self.target_guild_id, title, "HIGH", details))
        incident_id = cur.lastrowid

        if owner:
            embed = discord.Embed(title=f"üõ°Ô∏è {title}", description=details, color=color, timestamp=datetime.datetime.utcnow())
            await owner.send(embed=embed)
            if self.ai.enabled:
                insight = await self.ai.analyze_incident(title, details)
                db.execute("INSERT INTO ai_insights (incident_id, insight_text) VALUES (?, ?)", (incident_id, insight))
                ai_embed = discord.Embed(title="ü§ñ AI Threat Insight", description=insight[:2000], color=discord.Color.blue())
                await owner.send(embed=ai_embed)

bot = EnterpriseBot()

class BaseSecurityCog(commands.Cog):
    def __init__(self, bot): self.bot = bot
    def check_guild(self, guild): return guild.id == self.bot.target_guild_id
    def is_enabled(self, feature_id):
        res = db.fetch("SELECT enabled FROM features WHERE guild_id = ? AND feature_id = ?", (self.bot.target_guild_id, feature_id))
        return res["enabled"] == 1 if res else True

